    Storage -->|High Scores| UI`,diagramSvg:"/assets/diagrams/memory-match.svg",caseStudy:{technicalDetails:"A lightweight React game implementing a memory card-flip mechanic, tracking moves and time with audio cues and emoji-based card sets. Built for fast feedback loops and mobile-friendly interactions.",techStack:["React","HTML5/CSS3","JavaScript","Audio API","Web Storage"],architectureAndProcess:"Single-page React app with componentized game board, controls, and scoring overlays. State (cards, moves, timer) is kept in a single component or minimal context for easy reset and testing. Focused on lightweight bundle size and accessible controls.",systemArchitecture:"Client-only app  all gameplay runs in the browser. Uses local storage for high-scores and in-session state for the current match.",problem:"Create a simple, accessible memory game that is quick to pick up, replayable, and useful for cognitive exercises or light entertainment.",challengesAndSolutions:"Ensuring responsiveness across devices and keeping a tight game loop to avoid jank were the main challenges. Solutions: optimized rendering of card components, CSS animations over JS where possible, and debounced timing for user input to avoid race conditions."}},{title:"Telegram F1 Visa Tracker",image:"https://opengraph.githubassets.com/1/hppanpaliya/telegram-f1-visa-tracker",description:"A Python script that monitors Telegram groups for F1 visa slots and forwards relevant messages to users.",skills:["Python","Telegram API","Automation","Bot Development"],github:"https://github.com/hppanpaliya/telegram-f1-visa-tracker",demo:null,diagram:`graph TD
