    UI -->|Display| HTML`,diagramSvg:"/assets/diagrams/pdf-to-static-html.svg",caseStudy:{technicalDetails:"React + Firebase app that accepts PDF uploads, converts them to static HTML and stores the result in Firestore (or Cloud Storage). Conversion leverages PDF parsing libraries client-side or server-side depending on the implementation, and the output is served as static HTML pages.",techStack:["React","Firebase (Firestore, Storage)","pdf.js","React Dropzone","Node/Serverless (optional)"],architectureAndProcess:"User uploads PDF  conversion pipeline extracts page content  static HTML generated and saved to Firestore/Storage  client displays or links to resulting static page. Designed to be serverless-friendly (moves work to cloud functions or server when file size or processing needs grow).",systemArchitecture:"Frontend (React) conducts initial handling and possibly offloads heavy PDF parsing to a cloud function. Converted HTML and metadata stored in Firestore/Storage and served via a static hosting layer or CDN for fast access.",problem:"Converting PDFs to accessible static HTML pages simplifies publishing and webpage archiving and allows sharing content without exposing original PDF blobs or relying on complex server setups.",challengesAndSolutions:"Large PDF conversion can be CPU/memory heavy and browsers impose limits. Early versions did client-side conversion, but to scale the solution moving conversion to a serverless cloud function (or a managed worker) ensures reliability and allows larger files while keeping UI snappy with progress updates."}}]},FA=({setNavOpen:n})=>{const i=["About","Experience","Education","Skills","Projects","Contact","Resume"],l=(r,u)=>{r.preventDefault(),document.querySelector(u).scrollIntoView({behavior:"smooth"})};return v.jsx("header",{className:"fixed top-0 left-0 right-0 z-50 bg-slate-900/50 ",children:v.jsx("nav",{className:"max-w-7xl mx-auto px-4 sm:px-6 lg:px-8",children:v.jsxs("div",{className:"flex items-center justify-bet